import { Button, ButtonGroup } from "react-bootstrap";

const Menus = () => {
  return (
    <>
      <ButtonGroup className="justify-content-right">
        <Button className="mx-1">Button 1</Button>
        <Button className="mx-1">Button 2</Button>
      </ButtonGroup>
    </>
  );
};

export default Menus;
